import Header from './content/HeaderSection'
import Body from './content/BodyContent';
import { Box } from '@mui/material';

const inicio = () =>{
    return(
        
            <Box container>
                <Box maxWidth="1500px" sx={{display:"flex", justifyContent:"center", alignItems:"center"}}>
                    <Header></Header>
                    <Body></Body>
                </Box>
            </Box>
       
    );
}

export default inicio;
